__NUXT_JSONP__("/drugs/Telratolimod", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:b,chebiId:b,chemicalFormula:b,definition:"A toll-like receptor type 7 and 8 (TLR7\u002F8) agonist with potential immunostimulating and antitumor activities. Upon intratumoral administration, telratolimod binds to and activates TLR7 and 8, thereby stimulating antigen-presenting cells (APCs), including dendritic cells (DCs). Activation of DCs results in the production of proinflammatory cytokines, and the activation of cytotoxic T-lymphocyte (CTL) and B-lymphocyte immune responses. This may cause tumor cell lysis. TLR7 and 8, members of the TLR family, play fundamental roles in the activation of the immune system.",fdaUniiCode:"16598XQ2BT",identifier:"C124653",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C177176","C177177"],synonyms:["3M 052","3M-052","MEDI 9197","MEDI-9197","MEDI9197","TELRATOLIMOD","TLR7\u002FTLR8 Dual Agonist MEDI9197",a,"Toll-like Receptor 7\u002F8 Agonist MEDI9197"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTelratolimod",extension:".json",createdAt:"2021-10-30T13:30:20.733Z",updatedAt:"2021-10-30T13:30:20.743Z"}}],fetch:{},mutations:void 0}}("Telratolimod","")));